import React from 'react';
import { useFetchTodosQuery } from '../store'
import TodoItem from './TodoItem';
import { Typography, CircularProgress } from '@mui/material';

const TodoList = () => {
    const { data, error, isLoading } = useFetchTodosQuery();

    // Handle loading state
    if (isLoading) {
        return <div>Loading...</div>;
    }

    // Handle error state
    if (error) {
        return <div>Error fetching todos: {error.message}</div>;
    }

    // Check if data is defined and is an array
    const todos = data || []; // Default to an empty array if data is undefined

    return (
        <div>
            <h2>Todo List</h2>
            <ul>
                {todso.map(todo => (
                    <TodoItem key={todo.id} todo={todo} onDelete={{}} />
                ))}
            </ul>
        </div>
    );
};

export default TodoList;
